import { fromJS } from "immutable";

const defaultState = fromJS({
  topicItem: [
    {
      id: 1,
      title: "社會熱點",
      imgUrl: "https://miro.medium.com/max/640/1*vLaybAP69yhyWbz7chAEiQ.jpeg",
    },
    {
      id: 2,
      title: "手繪",
      imgUrl:
        "https://img.51miz.com/Element/01/02/09/52/5d0d28a2_E1020952_dc1c3bf7.jpg",
    }
  ],
  articleList: [
    {},
    {}
  ]
});

export default (state = defaultState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
